import React from 'react';
import Hero from '../components/Hero';
import NoticeBoard from '../components/NoticeBoard';
import Placement from '../components/Placement';

function Home() {
  return (
    <>
      <Hero />
      <NoticeBoard />
      <Placement />
    </>
  );
}

export default Home;
